function (::ConvolutionKernel{:b13,DO})(s::T) where {T,DO}
    b13_coefs_in = if DO == 0
        b13_coefs
    elseif DO == 1
        b13_coefs_d1
    elseif DO == 2
        b13_coefs_d2
    elseif DO == 3
        b13_coefs_d3
    elseif DO == 4
        b13_coefs_d4
    elseif DO == 5
        b13_coefs_d5
    elseif DO == 6
        b13_coefs_d6
    else
        error("kernel :b13 supports differentiation orders 0, 1, 2, 3, 4, 5, 6, but got $DO")
    end
    s_abs = abs(s)
    if s_abs < 1.0
        return horner(s_abs, b13_coefs_in, :eq1, T, DO) * (isodd(DO) ? T(sign(s)) : one(T))
    elseif s_abs < 2.0
        return horner(s_abs, b13_coefs_in, :eq2, T, DO) * (isodd(DO) ? T(sign(s)) : one(T))
    elseif s_abs < 3.0
        return horner(s_abs, b13_coefs_in, :eq3, T, DO) * (isodd(DO) ? T(sign(s)) : one(T))
    elseif s_abs < 4.0
        return horner(s_abs, b13_coefs_in, :eq4, T, DO) * (isodd(DO) ? T(sign(s)) : one(T))
    elseif s_abs < 5.0
        return horner(s_abs, b13_coefs_in, :eq5, T, DO) * (isodd(DO) ? T(sign(s)) : one(T))
    elseif s_abs < 6.0
        return horner(s_abs, b13_coefs_in, :eq6, T, DO) * (isodd(DO) ? T(sign(s)) : one(T))
    elseif s_abs < 7.0
        return horner(s_abs, b13_coefs_in, :eq7, T, DO) * (isodd(DO) ? T(sign(s)) : one(T))
    elseif s_abs < 8.0
        return horner(s_abs, b13_coefs_in, :eq8, T, DO) * (isodd(DO) ? T(sign(s)) : one(T))
    elseif s_abs < 9.0
        return horner(s_abs, b13_coefs_in, :eq9, T, DO) * (isodd(DO) ? T(sign(s)) : one(T))
    else
        return zero(T)
    end
end